import style from "./Landing.module.css";

const Landing = () =>{
    return(
        <div className={style.Landing}>
            <Link to="/home" className={style.Home}> 
                <p>S T A R T</p>
            </Link>
            {/* <img className={style.loadingtext} src="https://www.pngmart.com/files/22/Mr.-Rime-Pokemon-PNG.gif" alt="gif">Loading...</img> */}
        </div>
    )
};

export default Landing;
